import axios from 'axios';
import React, {useState} from 'react';
function App() {
  return (
    <div>
      <h1>title {user.title}</h1>
      <button onClick={GetPosts}>get</button>
    </div>
  );
}

function GetPosts() {
  const [user, setUser] = useState([])
  axios.get('http://localhost:8000/api/upv/')
  .then(res => {
    setUser(res.data)
  });

  <App body={user} />
}

export default App;
